import React from 'react';

import Ror2Poster from '../icons/Risk of Rain 2 poster.jpg'

const Homepage = () => {
    return (
        <div className='home-wrapper'>
            <div className='home-main-poster'><img src={Ror2Poster}/></div>
            <div className='home-about-game'>
                <p></p>
            </div>
        </div>
    )
}

export {Homepage}
